import React from 'react';
import "./styles/Profile.css";

const profile = (props) => {
    return(
    <div className="profile"> 
        <section className="profileSection">
            <ul>
                <li> <div className="pDiv"><p>Ihre User ID:</p>{props.user.id}</div></li>
                <li> <div className="pDiv"><p>Username::</p>{props.user.username}</div></li>
                <li> <div className="pDiv"><p>Name:</p>{props.user.name}</div></li>
                <li><div className="pDiv"><p>Vorname:</p>{props.user.firstName}</div></li>
                <li><div className="pDiv"><p>E-Mail:</p>{props.user.email}</div></li>
                <li><div className="pDiv"><p>angemeldet seit:</p>{props.user.signUpDate}</div></li>
            </ul>
        </section>
    </div>
    );
}

export default profile;
